import { useSelector } from "react-redux";
import { useRouter } from "next/router";

const dashboard = () => {
  const router = useRouter();
  const isLoaded = useSelector((state) => state.auth.isLoaded);
  if (!isLoaded) {
    router.push("/");
  }
  return <div>This is dashboard</div>;
};

export default dashboard;
